const Dropdown = ({ prods, links, className }) => {
  return (
    <div className={`dropdown ${className}`}>
      {hoveredItem?.products && (
        <div className="flex flex-col gap-2">
          {hoveredItem.products.map((item, index) => (
            <Link
              to={item.href}
              key={index}
              className="text-slate-50 hover:text-slate-950"
            >
              {item.label}
            </Link>
          ))}
        </div>
      )}
      {hoveredItem?.links && (
        <div className="flex flex-col gap-2">
          {hoveredItem.links.map((item, index) => (
            <Link
              to={item.href}
              key={index}
              className="text-slate-50 hover:text-slate-950"
            >
              {item.label}
            </Link>
          ))}
        </div>
      )}
    </div>
  );
};

export default Dropdown;
